import React from "react";
import Login from "./pages/Login";
import Register from "./pages/Register";
import "../src/App.css";

const App = () => {
  return (
    <div>
      <h1>Authentication App</h1>
      <Register />
      <Login />
    </div>
  );
};

export default App;
